package fcu.iecs.oop;


public class Break {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		 for(int i=0;i<5;i++)
		    {
		    	switch(i)
		    	{
		    	case 1:
		    		
		    		System.out.println("0");	
		    		break;
		    	case 2:
		    		
		    		System.out.println("1");	
		    		break;	
		    	case 3:
		    		
		    		break;
		    	case 4:
		    		
		    		break;
		    	case 5:
		    		
		    		break;
		    	}
		    	
		     }
    	
	}

}
